    //scroll calculation in update for evaluation
    ApgComponent.prototype.scrollCalculationAfter = function (data) {
        var _this = this;
        this.isScroll = true;
        //using setTimeout() for finish html create to get each div hegiht next calculate the totoal height and if div hight extra 400 add scroll and arrow if not remove scroll and arrow
        setTimeout(function () {
            for (var i = 0; i < data.length; i++) {
                var skillHeight = document.getElementById('skill-requirement-id-' + i);
                var skillHeader = document.getElementById('skillHeader' + i);
                var skillFooter = document.getElementById('skillFooter' + i);
                var innerBoxHeight = document.getElementById('requirement-inner-box-' + i);
                var req_total_height = 0;
                for (var j = 0; j < data[i].data.evaluation.details.length; j++) {
                    var requirement = document.getElementById('requirement' + j);
                    req_total_height += requirement.clientHeight;
                }
                var totalHeight = skillHeader.clientHeight +
                    skillFooter.clientHeight +
                    req_total_height;
                var inboxHight = 400 - (skillHeader.clientHeight + skillFooter.clientHeight);
                if (totalHeight < 400) {
                    skillHeight.setAttribute('style', 'height: auto;');
                    innerBoxHeight.setAttribute('style', 'height:auto;overflow:none;');
                    _this.templateAccessPointGroup[i].upDownOptions = false;
                    _this.templateAccessPointGroup[i].upOptions = false;
                    _this.templateAccessPointGroup[i].DownOptions = false;
                }
                else {
                    skillHeight.setAttribute('style', 'height: 400px;');
                    innerBoxHeight.setAttribute('style', 'height:' + inboxHight + 'px;overflow:overlay;');
                    _this.templateAccessPointGroup[i].upDownOptions = true;
                    _this.templateAccessPointGroup[i].upOptions = false;
                    _this.templateAccessPointGroup[i].DownOptions = true;
                }
            }
        }, 10);
    };
    // Create in scroll calculation for evaluation
