    ApgComponent.prototype.onclickUpdate = function (id, apgName) {
        var _this = this;
        console.log(id);
        this.maxExit = true;
        this.apgList = [];
        this.iscreate = true;
        this.isUpdate = true;
        if (apgName.module.name == 'Data') {
            var moduleId = localStorage.getItem('moduleID');
            var templateAccessPoint = {
                name: '',
                description: '',
                moduleId: moduleId,
                data: {
                    sectionType: 'DATA',
                    unit: ' ',
                    inputType: this.selectedRadio,
                    inputTypeProperties: {
                        name: '',
                        min: '',
                        max: '',
                        options: ['']
                    }
                }
            };
            this.templateAccessPointGroup = templateAccessPoint;
            this.dataApCreate = true;
            this.ismodule = false;
            this.apCreate = false;
        }
        else if (apgName.module.name == 'Assessment' ||
            apgName.module.name == 'Evaluation') {
            this.apCreate = true;
        }
        return new Promise(function (resolve, reject) {
            _this.singleAPG(id, 'update')
                .then(function (apId) {
                console.log('apid===>', apId);
                _this.moduleID = _this.model.moduleId;
                resolve(apId);
            })
                .catch(function (err) {
                console.log(err); // never called1
            });
        })
            .then(function (accespointId) {
            console.log('accespointId===>', accespointId);
            _this.getEditAccessPoint(_this.regionID, accespointId, apgName.module.name)
                .then(function (dataCollection) {
                console.log('successs', dataCollection);
                var tempArr = [];
                _this.templateAccessPointGroup = dataCollection;
                if (apgName.module.name == 'Evaluation' ||
                    apgName.module.name == 'Assessment') {
                    _this.templateAccessPointGroup.map(function (item) {
                        if (item.data.evaluation.passMark > 0) {
                            item.options = true;
                        }
                        else {
                            item.options = false;
                        }
                        tempArr.push(item);
                        _this.templateAccessPointGroup = tempArr;
                    });
                }
                _this.accessPointArrayString = JSON.stringify(dataCollection);
                _this.testArr = dataCollection;
                console.log(apgName.module.name);
                if (apgName.module.name.toLowerCase() == 'assessment' ||
                    apgName.module.name.toLowerCase() == 'evaluation') {
                    console.log('evaluation~~~');
                    setTimeout(function () {
                        _this.scrollCalculationAfter(_this.templateAccessPointGroup);
                    }, 10);
                }
                if (apgName.module.name.toLowerCase() == 'data') {
                    _this.sliderMinMax(dataCollection);
                }
            })
                .catch(function (err) {
                console.log(err); // never called
            });
            // this.templateAccessPointGroup.push(res)
            // this.accessPointArrayString.push(JSON.stringify(res));
        })
            .catch(function (err) {
            console.log(err); // never called
        });
    };
