    ApgComponent.prototype.getAPofModule = function (moduleId) {
        var _this = this;
        this._service.getAllAPmodule(this.regionID, moduleId).subscribe(function (res) {
            console.log('moduleAPLists', res);
            _this.moduleAPList = res;
            if (_this.getAccessPoint) {
                if (_this.newAP == false) {
                    for (var j in _this.getAccessPoint) {
                        _this.checkedAPid.push(_this.getAccessPoint[j]);
                        _this.apArray = _this.checkedAPid;
                        console.log(_this.apArray);
                    }
                    if (_this.tempModuleId != moduleId) {
                        _this.apArray = [];
                    }
                }
                else {
                    if (_this.tempModuleId) {
                        if (_this.tempModuleId != _this.apgField.moduleId) {
                            if (_this.responseAP) {
                                if (_this.responseAP.moduleId != _this.apgField.moduleId) {
                                    _this.apArray = [];
                                }
                            }
                            else {
                                _this.apArray = [];
                            }
                        }
                        else {
                            _this.apArray = _this.getAccessPoint;
                        }
                    }
                    else {
                        for (var j in _this.getAccessPoint) {
                            if (_this.apArray.indexOf(_this.getAccessPoint[j]) < 0) {
                                _this.apArray.push(_this.getAccessPoint[j]);
                            }
                        }
                    }
                    console.log(_this.apArray);
                    _this.checkedAPid = _this.getAccessPoint;
                }
            }
        }, function (err) {
            console.log(err);
        });
    };
