    ApgComponent.prototype.sharedApgSearch = function (keyword, limit, skip) {
        var _this = this;
        this.keyword = keyword;
        if (skip == '' && limit == '') {
            console.log('First time search');
            var isFirst = true;
            limit = 20;
            skip = 0;
        }
        if (keyword.length != 0) {
            this._service
                .getSearchTemplate(this.regionID, limit, skip, this.moduleID, keyword)
                .subscribe(function (res) {
                console.log('templateLists', res);
                if (isFirst == true) {
                    console.log('First time searching');
                    _this.templateList = [];
                    _this.templateList = res;
                }
                else {
                    console.log('Not First time searching');
                    // this.apgList = res;
                    _this.templateList = _this.templateList.concat(res);
                }
                _this.result = res;
            }, function (err) {
                console.log(err);
            });
        }
        else {
            setTimeout(function () {
                _this.templateList = [];
                _this.getAllTemplate(20, 0);
                _this.isSearch = false;
            }, 100);
        }
    };
