    ApgComponent.prototype.getAllAPG = function (limit, skip) {
        var _this = this;
        this.blockUI.start('Loading...');
        console.log(this.selectedAPGTab);
        this._service
            .getAllAPG(this.regionID, this.selectedAPGTab.id, limit, skip)
            .subscribe(function (res) {
            _this.apgList = [];
            _this.result = res;
            console.log('apgLists', res);
            if (_this.selectedAPGTab.name.toLowerCase() == 'all') {
                _this.allApgList = _this.allApgList.concat(res);
                _this.apgList = _this.allApgList;
            }
            else if (_this.selectedAPGTab.name.toLowerCase() == 'badge') {
                _this.badgeApg = _this.badgeApg.concat(res);
                _this.apgList = _this.badgeApg;
            }
            else if (_this.selectedAPGTab.name.toLowerCase() == 'progress') {
                _this.progressAPG = _this.progressAPG.concat(res);
                _this.apgList = _this.progressAPG;
            }
            else if (_this.selectedAPGTab.name.toLowerCase() == 'assessment' ||
                _this.selectedAPGTab.name.toLowerCase() == 'evaluation') {
                _this.evAPG = _this.evAPG.concat(res);
                _this.apgList = _this.evAPG;
            }
            else if (_this.selectedAPGTab.name.toLowerCase() == 'data') {
                _this.dataApgList = _this.dataApgList.concat(res);
                _this.apgList = _this.dataApgList;
            }
            for (var i = 0; i < _this.apgList.length; i++) {
                if (_this.apgList[i].module.name == 'Assessment' ||
                    _this.apgList[i].module.name == 'Evaluation') {
                    for (var j = 0; j < _this.apgList[i].accessPoints.length; j++) {
                        _this.apgList[i].accessPoints[j].isExpand = false;
                    }
                }
            }
            console.log('APG lists', _this.apgList);
            // this.apgList = res;
            // this.result = res;
            // this.apgList = this.apgList.concat(res);
            // console.log("apglists",this.apgList)
            if (res.length == 0) {
                _this.emptyAPG = true;
            }
            else {
                _this.emptyAPG = false;
            }
            setTimeout(function () {
                _this.blockUI.stop(); // Stop blocking
            }, 300);
        }, function (err) {
            console.log(err);
        });
    };
