    CourseComponent.prototype.cancelClassFun = function (lessonId) {
        var _this = this;
        var cancelData;
        if (this.reasonValue == null ||
            this.reasonValue.length == 0 ||
            this.reasonValue == undefined) {
            var noReason = {
                lessonId: lessonId,
                students: this.studentArray
            };
            cancelData = noReason;
        }
        else {
            var reason = {
                lessonId: lessonId,
                students: this.studentArray,
                message: this.reasonValue
            };
            cancelData = reason;
        }
        console.log(lessonId);
        console.log(this.isGlobal);
        // Call cancel class api service
        this.blockUI.start('Loading...');
        this._service
            .cancelUsersFromClass(this.courseId, cancelData, this.isGlobal)
            .subscribe(function (res) {
            // Success function
            _this.blockUI.stop();
            _this.cancelUI = false;
            _this.cancelUi = false;
            console.info('cancle user from class api calling is done');
            console.log(res);
            _this.isGlobal = false;
            _this.disableCancel = true;
            _this.getCourseDetail(_this.courseId);
            _this.studentArray = [];
            _this.modalClose();
            // Close Dialog box
            // Show the canceled users
        }, function (err) {
            // Error function
            _this.isGlobal = false;
            console.error('cancle user from class has got error', err);
            // Do something
        });
        this.cancelUItext = false;
    };
