    CourseComponent.prototype.getCourseLists = function (limit, skip) {
        var _this = this;
        this.blockUI.start('Loading...');
        this._service
            .getAllCourse(this.regionId, this.locationID, limit, skip)
            .subscribe(function (res) {
            console.log('Course List', res);
            _this.result = res;
            console.log(_this.result);
            console.log(_this.result.length);
            console.log(_this.courseList);
            _this.courseList = _this.courseList.concat(res);
            console.log(_this.courseList);
            console.log(_this.courseList.length);
            if (_this.courseList.length > 0) {
                _this.emptyCourse = false;
                for (var i in _this.courseList) {
                    var duration = _this.courseList[i].coursePlan.lesson.duration;
                    // console.log(duration);
                    for (var j in _this.courseList[i].courses) {
                        var date = _this.courseList[i].courses[j].startDate;
                        if (date) {
                            var starttime = date.substring(date.search('T') + 1, date.search('Z') - 7);
                            // console.log(date);
                            // console.log('starttime',starttime);
                            var piece = starttime.split(':');
                            var mins = piece[0] * 60 + +piece[1] + +duration;
                            var endtime = _this.D(((mins % (24 * 60)) / 60) | 0) +
                                ':' +
                                _this.D(mins % 60);
                            // console.log('endtime',endtime)
                            _this.courseList[i].courses[j].courseDuration = {
                                starttime: starttime,
                                endtime: endtime
                            };
                        }
                        // // console.log(date);
                        // // console.log('starttime',starttime);
                        // let piece = starttime.split(':');
                        // let mins = piece[0]*60 + +piece[1] + +duration;
                        // let endtime = this.D(mins%(24*60)/60 | 0) + ':' + this.D(mins%60);
                        // // console.log('endtime',endtime)
                        // this.courseList[i].courses[j].courseDuration = {"starttime": starttime, "endtime": endtime};
                    }
                }
            }
            else {
                _this.emptyCourse = true;
            }
            setTimeout(function () {
                _this.blockUI.stop(); // Stop blocking
            }, 500);
        });
    };
