    CoursecreateComponent.prototype.enrollUser = function (createdCID, userID) {
        var _this = this;
        console.log('courseID', createdCID);
        return new Promise(function (resolve, reject) {
            _this._service.editProfile(_this.regionID, userID).subscribe(function (res) {
                console.log('res UserDetail', res);
                _this.userDetail.user = res;
            });
            _this._service
                .getSingleCourse(createdCID, _this.locationId)
                .subscribe(function (res) {
                console.log('res CourseDetail', res);
                _this.courseDetails = res;
            });
            resolve();
        }).then(function () {
            var body = {
                courseId: createdCID,
                userId: userID,
                userType: 'customer'
            };
            // this.modalReference = this.modalService.open('invModal', { backdrop:'static', windowClass: 'modal-xl modal-inv d-flex justify-content-center align-items-center'});
            setTimeout(function () {
                _this._service
                    .assignUser(_this.regionID, body, _this.locationId)
                    .subscribe(function (res) {
                    // this.showInvoice = true;
                    _this.modalReference = _this.modalService.open(_this.modalContent, {
                        backdrop: 'static',
                        windowClass: 'modal-xl modal-inv d-flex justify-content-center align-items-center'
                    });
                    _this.showInvoice = true;
                    Object.assign(_this.courseDetails, res);
                    console.log('CALL INVOICE', _this.courseDetails);
                    console.log('==>', _this.userDetail);
                });
            }, 500);
        });
    };
