    CoursecreateComponent.prototype.changeDateFormat = function (date, time) {
        console.log('==>date,time', date, time);
        if (date == null) {
            console.log('null', date);
            return '';
        }
        else {
            console.log('utc date', date);
            console.log('Time', time);
            var sdate = date.year + '-' + date.month + '-' + date.day;
            console.log(sdate);
            var dateParts = sdate.split('-');
            console.log('dateParts', dateParts);
            if (dateParts[1]) {
                console.log(Number(dateParts[1]) - 1);
                var newParts = Number(dateParts[1]) - 1;
                dateParts[1] = newParts.toString();
            }
            var timeParts = time.split(':');
            if (dateParts && timeParts) {
                // let testDate = new Date(Date.UTC.apply(undefined,dateParts.concat(timeParts)));
                // console.log("UTC",testDate)
                var fullDate = new Date(Date.UTC.apply(undefined, dateParts.concat(timeParts))).toISOString();
                console.log('ISO', fullDate);
                return fullDate;
            }
        }
    };
