    /// Fix Get Sechedule Staff API ///
    ScheduleComponent.prototype.getschedulestaff = function (type, limit, skip, index) {
        var _this = this;
        setTimeout(function () {
            _this.updateScrollbar('v-wrapper');
        }, 1000);
        var repeatDays;
        if (this.selectedDay.length == 0 || this.selectedDay.length < 0) {
            repeatDays = '0,1,2,3,4,5,6';
        }
        else {
            repeatDays = this.selectedDay.toString();
        }
        console.log(this.regionId);
        console.log(repeatDays);
        console.log(this.selectedID);
        console.log(limit);
        console.log(skip);
        this.scheduleList = false;
        this._service
            .getscheduleStaffList(this.regionId, repeatDays, this.selectedID, limit, skip)
            .subscribe(function (res) {
            console.log(res);
            _this.result = res;
            _this.staffList = res;
            console.log('this.selectedTeacher', _this.selectedTeacher);
            console.log('this.staffList', _this.staffList);
            if (_this.staffList.staff.length > 0) {
                if (_this.staffList.staff && type == 'checkbox') {
                    if (_this.isTeacherAll) {
                        // remove auto selected
                        _this.isTeacherAll = true;
                    }
                    else {
                        console.log('exit');
                        _this.selectedTeacher = _this.tempSelectedTeacher;
                        if (_this.tempSelectedTeacher == null) {
                            _this.selectedTeacher = _this.staffList.staff[0];
                            _this.isTeacherAll = false; // remove auto selected
                        }
                    }
                }
                else if (type == 'modalteacher') {
                    console.log('two');
                    _this.selectedTeacher = _this.tempSelectedTeacher;
                    _this.isTeacherAll = false;
                    console.log('selected teacher');
                }
                else {
                    console.log('three', _this.staffList.staff);
                    console.log(_this.selectedTeacher);
                    if (_this.staffList.staff) {
                        _this.tempSelectedTeacher = null;
                        // this.selectedTeacher = this.staffList.staff[0];
                        _this.isTeacherAll = true;
                    }
                }
                console.log('Call staff timttable');
                if (JSON.stringify(_this.selectedTeacher) != '{}' ||
                    _this.isTeacherAll) {
                    console.log('reach');
                    _this.getStaffTimetable(_this.selectedTeacher.userId, repeatDays);
                }
                if (_this.isTeacherAll) {
                    _this.selectedTeacher = {};
                }
            }
            else {
                console.log('no need to call staff timttable');
            }
            setTimeout(function () {
                if (type == 'modalteacher') {
                    _this.overFlowWidth(index, type);
                }
                else if (type == 'button') {
                    _this.overFlowWidth(20, type);
                }
            }, 300);
            if (_this.tempTchr != undefined) {
                _this.staffList.staff.map(function (staff, indexNumber) {
                    if (staff.userId == _this.tempTchr.userId) {
                        _this.staffList.staff.splice(_this.staffList.staff.indexOf(staff), 1);
                    }
                });
                _this.staffList.staff.unshift(_this.tempTchr);
            }
            $('body').css('overflow', 'hidden');
        }, function (err) {
            // catch the error response from api
            _this.staffList = [];
        });
    };
