    ScheduleComponent.prototype.getSearchCoursePlan = function (searchWord, skip, limit) {
        var _this = this;
        this.keyword = searchWord;
        if (skip == '' && limit == '') {
            var isFirst = true;
            limit = 20;
            skip = 0;
        }
        if (searchWord.length != 0) {
            this.isSearch = true;
            this._service
                .getSearchCoursePlan(this.regionId, this.locationID, this.selectedID, skip, limit, searchWord)
                .subscribe(function (res) {
                _this.result = res;
                if (isFirst == true) {
                    console.log('First Time Searching');
                    _this.courseplanLists = [];
                    _this.courseplanLists = res;
                }
                else {
                    console.log('Not First Time Searching');
                    _this.courseplanLists = _this.courseplanLists.concat(res);
                }
            }, function (err) {
                console.log(err);
            });
        }
        else {
            setTimeout(function () {
                _this.courseplanLists = [];
                _this.getAllCoursePlan(skip, limit);
                _this.isSearch = false;
            }, 300);
        }
    };
