    /** ************** *** ************** *** **************  start Image Gallery Modal*** ************** *** ************** *** ************** *** ************** */
    //get all content
    TestwerkzComponent.prototype.getAllContent = function (page, size, keyword) {
        var _this = this;
        // console.log(page,size,keyword);
        // this.ImgArr = [];
        // this.videoArr = [];
        //  console.error(page,size)
        var isFirst;
        if (page === 1) {
            isFirst = true;
        }
        else {
            isFirst = false;
        }
        this.blockUI.start('Loading...');
        // console.log(this.ImgArr)
        return new Promise(function (resolve, reject) {
            _this._service
                .getContent(_this.regionID, page, size, keyword, _this.contentType)
                .subscribe(function (res) {
                _this.result = res;
                _this.contentRes = res;
                _this.contentArr = res;
                _this.content_size = size;
                if (_this.modelType == 'multiple' || _this.modelType == 'single') {
                    if (res.length > 0) {
                        for (var i = 0; i < res.length; i++) {
                            if (_this.contentType == 'image') {
                                if (res[i].type == 'image/gif' ||
                                    res[i].type == 'image/png' ||
                                    res[i].type == 'image/jpeg') {
                                    _this.ImgArr.push(res[i]);
                                }
                            }
                        }
                        _this.tempContentArr = _this.ImgArr;
                        console.log('ImgArr', _this.tempContentArr);
                    }
                    else {
                        _this.ImgArr = _this.ImgArr;
                        console.log('ImgArr####', _this.ImgArr);
                    }
                }
                else {
                    _this.videoArr = res;
                    if (isFirst == true) {
                        _this.videoArr = res;
                        // this.isSearch = true;
                        _this.contentPage = 1;
                        console.log(_this.videoArr, 'first time searching');
                        _this.tempContentArr = _this.videoArr;
                    }
                    else {
                        _this.isSearch = false;
                        res.map(function (content) {
                            _this.videoArr.push(content);
                        });
                        console.log(_this.videoArr, 'not first time searching');
                    }
                }
                resolve();
                _this.blockUI.stop();
            }, function (err) {
                console.log(err);
            });
        });
    };
