    TestwerkzComponent.prototype.validateForm = function () {
        if (!this.concept.name) {
            this.isConceptFormValid = false;
            return this.isConceptFormValid;
        }
        var pds = this.performanceDemands;
        var checkPDs = pds.map(function (pd) {
            if (!pd.name) {
                return false;
            }
            var questions = pd.questions.map(function (quest) {
                if (!quest.question) {
                    return false;
                }
                // const noAnswer = quest.answers.some(ans => ans.answer === "");
                // if (!noAnswer) {
                //   return quest.answers.some(ans => ans.correctness === 100);
                // }
                var noAnswer = false;
                var test = quest.answers.map(function (ans) {
                    if ((ans.answer == '' && ans.imgUrl != '') ||
                        (ans.answer != '' && ans.imgUrl == '') ||
                        (ans.answer != '' && ans.imgUrl != '')) {
                        // console.log("has one~~~");
                        // has on ans (Img Or text)
                        noAnswer = true;
                    }
                    else if (ans.answer == '' && ans.imgUrl == '') {
                        // console.log("not has one")
                        noAnswer = false;
                    }
                    // else{
                    //   console.log("true~~~");
                    // }
                });
                if (noAnswer) {
                    return quest.answers.some(function (ans) { return ans.correctness === 100; });
                }
                return false;
            });
            return !questions.includes(false);
        });
        this.isConceptFormValid = !checkPDs.includes(false);
        return this.isConceptFormValid;
    };
